  03> LUDBROOK, Hamish William
  b 12.12.1983
  Hamish b. at Pakaraka. He is a full boarding student at St John's House, King's
  College, Auckland. In 1996 he was an Auckland schoolboy rugby representative and in
  his first year at King's he was selected for the Under-15 rep team. He is the only
  Ludbrook grandson in this branch of the family.
  06> LUDBROOK, Kenneth William m on 23.02.1980 to WAKE, Suzanne
  b 16.12.1951
  b 31.12.1959
  Kenneth b, at Taiamai and m. at St Andrew's Church, Cambridge. Suzanne, d/o Gerald Wake and Joan Pipe.
  Address: 11 Shaw Street, Cambridge.
  Kenneth was educated at Dilworth School, Auckland and Central Institute of Technology, Wellington and
  is a pharmacist at Leamington, Cambridge.
